import DeleteIcon from '@material-ui/icons/Delete';

const Note = () =>{
    return (
    <>
    <div className="note">
    <h1>Title</h1>
    <p>This is Content hello i am amrit raj mauyra of jehanabad of heritage institute </p>
    <DeleteIcon className="delete_icon" />
    </div>
    </>
    )
}

export default Note;
